def showImg(img):
    Img = np.asarray(img)
    listChar = [' ', '.', '*','`', '^','*','-',':','+','!','i','e','o','a','s','&','#','B', '@' ]
    txt = ''
    index=0

    for x in range(Img.shape[0]):
        for y in range(Img.shape[1]):
            index = round(Img[x][y]/15)
            if index == 0:
                txt = txt + ' '
                continue
            txt = txt + listChar[index]
        txt = txt + '\n'

    leng = len(txt)
    for x in range(leng):
        print(txt[x],end="")
        if(txt[x] == '\n'):
            time.sleep(0.0001)
        if(x == leng-1):
            print("")

